  <style>

    svg path {
      fill: #3773A7;
      stroke-linejoin: round;
      transform: matrix(0.496, 0, 0, 0.496, 0, 0);
      -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
      opacity: 1;
      cursor: pointer;
      stroke-opacity: 1;
      stroke-linejoin: round;
      fill-opacity: 1;
      stroke: #ffffff;
      opacity: 1;
      stroke-opacity: 1;

    svg path:hover {
      fill: blue;
      /* stroke: green; */
    }

    .available {
      fill: none;
      fill-rule: evenodd;
      stroke: #000000;
      stroke-width: 1px;
      stroke-linecap: butt;
      stroke-linejoin: miter;
      stroke-opacity: 1
    }



    .modal {
      display: none;
      /* Hidden by default */
      position: fixed;
      /* Stay in place */
      z-index: 1;
      /* Sit on top */
      padding-top: 100px;
      /* Location of the box */
      left: 0;
      top: 0;
      width: 100%;
      /* Full width */
      height: 100%;
      /* Full height */
      overflow: auto;
      /* Enable scroll if needed */
      background-color: rgb(0, 0, 0);
      /* Fallback color */
      background-color: rgba(0, 0, 0, 0.4);
      /* Black w/ opacity */
    }

    /* Modal Content */
    .modal-content {
      background-color: #fefefe;
      margin: auto;
      padding: 10px;
      border: 1px solid #888;
      width: 50%;
      border-radius: 20px;
    }

    /* The Close Button */
    .close {
      color: #aaaaaa;
      float: right;
      font-size: 28px;
      font-weight: bold;
    }

    .close:hover,
    .close:focus {
      color: #000;
      text-decoration: none;
      cursor: pointer;
    }

    #table_row_detail {
      border-collapse: collapse;
      border-spacing: 0;
      width: 100%;
      border: 1px solid #ddd;
    }

    #table_row_detail th, #table_row_detail td {
      text-align: left;
      padding: 10px;
    }

    #table_row_detail tr:nth-child(even) {
      background-color: #f2f2f2;
    }

  </style>

  <script>

    function loadLabelProvinceName(PROVINCE_ID) {
      $.getJSON("/data/cambodia.json")
        .done(function (json) {
          $("#lbl_" + PROVINCE_ID).text(json[PROVINCE_ID].name);
        })
        .fail(function (jqxhr, textStatus, error) {
          var err = textStatus + ", " + error;
          console.log("Request Failed: " + err);
        })
      ;
    }

    function openOpenModalPopup(PROVINCE_ID) {

      $.getJSON("/data/cambodia.json")
        .done(function (json) {
          console.clear();
          $("#lbl_province_name").text(json[PROVINCE_ID].name);
          $("#myBtn").click();
        })
        .fail(function (jqxhr, textStatus, error) {
          var err = textStatus + ", " + error;
          console.log("Request Failed: " + err);
        });

    }





    // Get the modal
    var modal = document.getElementById("myModal");

    // Get the button that opens the modal
    var btn = document.getElementById("myBtn");

    // Get the <span> element that closes the modal
    var span = document.getElementsByClassName("close")[0];

    // When the user clicks the button, open the modal 
    btn.onclick = function () {
      modal.style.display = "block";
    }

    // When the user clicks on <span> (x), close the modal
    span.onclick = function () {
      modal.style.display = "none";
    }

    // When the user clicks anywhere outside of the modal, close it
    window.onclick = function (event) {
      if (event.target == modal) {
        modal.style.display = "none";
      }
    }

  </script>
